This fun series is an off-shoot of the brief animated series of the same name that ran on Cartoon Network and features the exploits of Krypto, Superman's famous superpowered dog. Full credits for the miniseries are by Jesse L McCann (Author), Jeff Albrecht (Author), Dave Tanguay (Author), Min S Ku (Illustrator). McCann in particular is known for his all-ages work on Looney Tunes, The Simpsons and Futurama comics and he keeps the story light and brisk. It's a fun read and if you are a fan of Krypto, it is definitely worth checking out. Plot summary - &quot;As the Last Pup of Krypton arrives on Earth, he meets his host family and new friend Kevin, and fights crime!&quot;

This is all six issues in digital format thanks to Empire. Please seed, and enjoy! :-)
